import Layout from '../components/Layout'

const Index = (props) => {
  return (
    <Layout>
      <div className='main'>
        <div className='main-intro'>
          Hi I'm Noah, <br />I like building stuff online.
        </div>
        <div className='sub-intro'>
          Check out, my projects below, <br />
          and feel free to <a>get in touch</a>.
        </div>
      </div>
      <style jsx>{`
      .main-intro {
        font-size: 2.5rem;
        line-height: 2.7rem;
        margin-bottom: 15px;
      }  
      .sub-intro {
        font-size: 1.5rem;
        max-width: 400px;
      }
      .main {
        margin-top: 50px;
      }
      a {
        text-decoration: none;
        transition: all 200ms linear;
        color: black;
      }
      a:visited {
        color: black;
      }

      a:hover, a:focus {
        color: #1ED760;
      }

      `}</style>
    </Layout>
  )
}

export default Index
